import React from 'react'

const Employees = ({ employees }) => {
  return (
    <div width="100%">
      <center><h1>Employee List</h1></center>
      {employees.map((employee) => (
        <table width="500"><th><td width="20%">{employee.code}</td><td width="20%">{employee.name}</td><td width="20%">{employee.age}</td><td width="20%">{employee.address}</td><td width="20%">{employee.department}</td></th></table>

      ))}
    </div>
  )
};

export default Employees
